import React, { useEffect, useState } from 'react';

const Test = () => {
  const [mosques, setMosques] = useState('');

  useEffect(() => {
    const fetchMosques = async () => {
      const response = await fetch('http://localhost:5000/mosques/');
      const json = await response.json();

      if (response.ok) {
        setMosques(json);
      }
    };

    fetchMosques();
    console.log(mosques);
  }, []);
  return (
    <div>
      <p>this idfgfds test</p>

      
      <img src="data:image/png;base64," alt="" />
      
    </div>
  );
};

export default Test;